<h6 class="MarginalNote"><span class="wb-invisible">Note marginale :</span>Précisions</h6><p class="Section"><strong><a id="s-9."><span class="sectionLabel">9.</span></a></strong> Il ne fait pas partie de l’accord et ne constitue ni un traité ni un accord sur des revendications territoriales au sens des articles 25 et 35 de la <cite class="XRefExternalAct"><a href="/fra/Const/">Loi constitutionnelle de 1982</a></cite>.</p>
